Actie
94 minuten

goed

met Dolph Lundgren, Raicho Vasilev en Ben Cross

De keiharde paratrooper Nikolai Cherenko, die gediend heeft in Afghanistan, werkt en woont in een voorstad van St. Petersburg. Op 
een dag wordt hij geconfronteerd met de verschrikkelijke moord op zijn vrouw en zijn enig kind. De moordenaar is Sasha, een 
sadistische drugdealer en bordeelhouder. Nikolai spoort hem en zijn bende op, schiet iedereen neer en verdwijnt, in de 
veronderstelling dat hij ze allemaal vermoord heeft...
